    Fix exception in callback function.

    Exception would occur in the nope condition if yepnope had this definition:

    yepnope({
      test: Modernizr.geolocation,
      yep: {
        'rstyles': 'regular-styles.css'
      },
      nope: {
        'mstyles': 'modified-styles.css',
        'geopoly': 'geolocation-polyfill.js'
      },
      callback: {
        'rstyles': function (url, result, key) {
          alert('This is the regular styles!');
        }
      }
    })

    Fixed by checking to see if innerCb is defined before attempting to call innerCb
(In the official byte minimized way :-) )

Fix exception in callback function.

Exception would occur in the nope condition if yepnope had this definition:

yepnope({
  test: Modernizr.geolocation,
  yep: {
    'rstyles': 'regular-styles.css'
  },
  nope: {
    'mstyles': 'modified-styles.css',
    'geopoly': 'geolocation-polyfill.js'
  },
  callback: {
    'rstyles': function (url, result, key) {
      alert('This is the regular styles!');
    }
  }
})

Fixed by checking to see if innerCb is defined before attempting to call innerCb
